import React from 'react';
import './formComponent.css';
import { CustomCountryDropdown } from '../countryList/countryListComponent';

const Form = props => {
  return (
    <div className="container h-100">
      <form onSubmit={props.loadweather}>
        <div>{props.error ? error() : ""}</div>
        <div className="row">
          <div className="col-md-3 offset-md-2">
            <input type="text" className="form-control" placeholder="City" name="city" autoComplete="on" />
          </div>
          <div className="col-md-3">
             <CustomCountryDropdown />
            {/*<input type="text" className="form-control" placeholder="Country" name="country" autoComplete="on" />*/}
          </div>
          <div className="col-md-3 mt-md-0 mt-2 text-md-left ">
            <button style={{marginLeft: 35}} className="btn btn-warning">Get Weather</button>
          </div>
        </div>
      </form>
    </div>
  );
};

const error = props => {
  return (
    <div className="alert alert-danger mx-5" role="alert"> Please Enter City and Country...! </div>
  );
};

export default Form;
